"use strict";
const nodemailer = require("nodemailer");
var inlineBase64 = require('nodemailer-plugin-inline-base64');

// async..await is not allowed in global scope, must use a wrapper
async function main() {
  // Generate test SMTP service account from ethereal.email
  // Only needed if you don't have a real mail account for testing
  // let testAccount = await nodemailer.createTestAccount();
  const testAccount = {
    user: "cordell.hermann20@ethereal.email", 
    pass: "cuYBkaa8MEYsZ6GBd8"
  };

  // create reusable transporter object using the default SMTP transport
  let transporter = nodemailer.createTransport({
    host: "smtp.ethereal.email",
    port: 587,
    // secure: false, // true for 465, false for other ports
    auth: {
      user: testAccount.user, // generated ethereal user
      pass: testAccount.pass, // generated ethereal password
    },
  });

  // The option for inlineBase64 allows us to set the CID prefix
  // In which case all inline images will have prefix in CID.
  // transporter.use('compile', inlineBase64({cidPrefix: 'somePrefix_'}));
  // otherwise, we can leave it empty.
  transporter.use('compile', inlineBase64({cidPrefix: 'somePrefix_'}));

  let info = await transporter.sendMail({
    from: 'me@example.com',
    to: 'hello@mixmax.com',
    subject: "Hello âœ” Ish Ish", // Subject line
    text: "Hello Ish, I have great news!", // plain text body
    html: '<img src="data:image/jpeg;base64,">'
  });

  console.log("Message sent: %s", info.messageId);
  // Message sent: <b658f8ca-6296-ccf4-8306-87d57a0b4321@example.com>

  // Preview only available when sending through an Ethereal account
  console.log("Preview URL: %s", nodemailer.getTestMessageUrl(info));
  // Preview URL: https://ethereal.email/message/WaQKMgKddxQDoou...
}

main().catch(console.error);

